import React from 'react';
import { useTranslation } from 'react-i18next';

const Skills: React.FC = () => {
  const { t } = useTranslation();

  const skillCategories = [
    {
      title: t('skills.categories.frontend'),
      icon: 'üé®',
      skills: [
        { name: 'React', level: 95 },
        { name: 'TypeScript', level: 90 },
        { name: 'Vue.js', level: 85 },
        { name: 'CSS/SASS', level: 90 },
        { name: 'HTML5', level: 95 }
      ]
    },
    {
      title: t('skills.categories.backend'),
      icon: '‚öôÔ∏è',
      skills: [
        { name: 'Node.js', level: 90 },
        { name: 'Python', level: 85 },
        { name: 'Express.js', level: 88 },
        { name: 'Django', level: 80 },
        { name: 'REST APIs', level: 92 }
      ]
    },
    {
      title: t('skills.categories.database'),
      icon: 'üóÑÔ∏è',
      skills: [
        { name: 'MongoDB', level: 85 },
        { name: 'PostgreSQL', level: 80 },
        { name: 'Redis', level: 75 },
        { name: 'MySQL', level: 82 },
        { name: 'Firebase', level: 78 }
      ]
    },
    {
      title: t('skills.categories.tools'),
      icon: 'üõ†Ô∏è',
      skills: [
        { name: 'Git', level: 90 },
        { name: 'Docker', level: 80 },
        { name: 'Webpack', level: 75 },
        { name: 'Jest', level: 85 },
        { name: 'Figma', level: 70 }
      ]
    },
    {
      title: t('skills.categories.cloud'),
      icon: '‚òÅÔ∏è',
      skills: [
        { name: 'AWS', level: 75 },
        { name: 'Vercel', level: 85 },
        { name: 'Netlify', level: 80 },
        { name: 'Heroku', level: 78 },
        { name: 'GitHub Actions', level: 70 }
      ]
    }
  ];

  return (
    <section id="skills" className="section">
      <div className="animate-fade-in-up">
        <h2 className="section-title font-cinzel">
          {t('skills.title')}
        </h2>

        <div className="grid grid-2">
          {skillCategories.map((category, index) => (
            <div 
              key={index}
              className="card animate-fade-in-up"
              style={{ animationDelay: `${index * 0.1}s` }}
            >
              <div style={{ 
                display: 'flex', 
                alignItems: 'center', 
                marginBottom: '1.5rem' 
              }}>
                <span style={{ fontSize: '2rem', marginRight: '1rem' }}>
                  {category.icon}
                </span>
                <h3 className="font-playfair" style={{ 
                  color: 'var(--accent-primary)',
                  fontSize: '1.3rem'
                }}>
                  {category.title}
                </h3>
              </div>

              <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
                {category.skills.map((skill, skillIndex) => (
                  <div key={skillIndex}>
                    <div style={{ 
                      display: 'flex', 
                      justifyContent: 'space-between',
                      marginBottom: '0.5rem'
                    }}>
                      <span style={{ fontWeight: '600' }}>{skill.name}</span>
                      <span style={{ 
                        color: 'var(--accent-primary)',
                        fontSize: '0.9rem'
                      }}>
                        {skill.level}%
                      </span>
                    </div>
                    
                    <div style={{
                      width: '100%',
                      height: '8px',
                      background: 'var(--bg-tertiary)',
                      borderRadius: '4px',
                      overflow: 'hidden'
                    }}>
                      <div 
                        style={{
                          width: `${skill.level}%`,
                          height: '100%',
                          background: 'var(--gradient-accent)',
                          borderRadius: '4px',
                          transition: 'width 1s ease-out',
                          animation: `skillBar${skillIndex} 1.5s ease-out ${index * 0.1 + skillIndex * 0.1}s both`
                        }}
                      />
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>

      <style>{`
        ${skillCategories.map((category, categoryIndex) => 
          category.skills.map((skill, skillIndex) => `
            @keyframes skillBar${skillIndex} {
              from { width: 0%; }
              to { width: ${skill.level}%; }
            }
          `).join('')
        ).join('')}
      `}</style>
    </section>
  );
};

export default Skills;
